if(!Date.prototype.getWeekNumber){Date.prototype.getWeekNumber=function(){var d=new Date(+this);d.setHours(0,0,0);d.setDate(d.getDate()+4-(d.getDay()||7));return Math.ceil(((d-new Date(d.getFullYear(),0,1))/864e5+1)/7)}}if(!Date.prototype.nextYear){Date.prototype.nextYear=function(){return new Date(this.getTime()+31536e6)}}if(!Date.prototype.nextYearGMTString){Date.prototype.nextYearGMTString=function(){return this.nextYear().toGMTString()}}if(!Date.unixZero){Date.unixZero=function(){return new Date(0)}}if(!Date.unixZeroGMTString){Date.unixZeroGMTString=function(){return new Date(0).toGMTString()}}if(!Date.prototype.log){Date.prototype.log=function(){console.log(this.constructor.toString().split(" ")[1].replace("()","").toLowerCase()+"("+this.toLocaleString().length+"): "+this.toLocaleString())}}